@Override
void decodeStats() throws IOException {
  final FST.Arc<Long> arc = topFrame().arc;
  if (arc.isFinal()) {
    ord = fstOutputs.add(arc.output, arc.nextFinalOutput);
  } else {
    ord = arc.output;
  }
  super.decodeStats();
}

